import React from 'react';
import { countries } from '../countries'; // Adjust the path according to your file structure

const Page2 = ({ onNext, onBack, formData }) => {
  console.log("first", formData);

  return (
    <div>
      <h2>Hi {formData.firstName} {formData.lastName}</h2>
      <table>
        <thead>
          <tr>
            <th>Country</th>
            <th>Check</th>
          </tr>
        </thead>
        <tbody>
          {countries.map((country, index) => (
            <tr key={index}>
              <td>{country.name}</td>
              <td>
                <input type="checkbox" id={`country-${country.code}`} name="country" value={country.code} />
                <label htmlFor={`country-${country.code}`}></label>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <button onClick={onBack}>Back</button>
      <button onClick={onNext}>Save and Proceed</button>
    </div>
  );
};

export default Page2;
